import java.util.HashMap;
import java.util.List;
import java.util.Map;

class Solution {
    public long maximumSum(List<Integer> nums) {
        Map<Long, Long> freq = new HashMap<>();
        for (int a : nums) {
            long mask = 0;
            for (int i = 2; i * i <= a; i++) {
                int count = 0;
                while (a % i == 0) {
                    a /= i;
                    count++;
                }
                if (count % 2 == 1) mask |= (1L << i);
            }
            if (a > 1) mask |= (1L << a);
            freq.put(mask, freq.getOrDefault(mask, 0L) + a);
        }

        long ans = 0;
        for (long sum : freq.values()) {
            ans = Math.max(ans, sum);
        }
        return ans;
    }
}
